import React from "react";
import Slider from "react-slick";
import { TrendingLayout } from "./trending_Layout";

export class TrendingSlider extends React.Component {
  render() {
    const settingBannerSlide = {
      // centerMode: true,
      lazyLoad: false,
      slidesToShow: 1,
      slidesToScroll: 1,
      arrows: true,
      fade: true,
      infinite: true,
      autoplay: true,
      draggable: true,
      focusOnSelect: false,
      initialSlide: 0, // slide to start
      useTransform: false,
      waitForAnimate: true,
      dots: false,
      autoplaySpeed: 2500,
      // asNavFor: ".thumbnail_slider",
    };
    return (
      <div className="a_trending__layout_">
        <Slider className="a_trending__slides" {...settingBannerSlide}>
            <TrendingLayout></TrendingLayout>
            <TrendingLayout></TrendingLayout>
        </Slider>
      </div>
    );
  }
}
